{"title":"gerrit_efficiency_help","type":"markdown","params":{"fontSize":10,"markdown":"This panel focuses on **closed** Gerrit changesets.

**REI**: Review Efficiency Index, defined as the number of closed changesets divided by the number of open ones in a given period of time. Measures efficiency closing changesets.

**Lead time**: the time expressed in days between the initiation and completion of a production process, in this case, a changeset. Shown in average."},"aggs":[]}
